Cuttlefish: Kings of Camouflage

Nature Documentary hosted by Lance Lewman, published by PBS broadcasted as part of PBS Nova series in 2007 - English narration


Information
------------------------------

Call it a case of mistaken identity. When it comes to camouflage, chameleons get all the attention. But the often-overlooked cuttlefish is the real master of disguise. Cousins of the squid and octopus, cuttlefish are among the most unusual animals on our planet. With stunning underwater footage and in-depth expert interviews, NOVA gets up close and personal with this astonishing brainy bunch.

